import React from 'react';
import { useNavigate } from 'react-router-dom';
import {
  Box,
  Typography,
  Grid,
  Paper,
  Button,
  Chip,
  TextField,
  InputAdornment,
  Avatar
} from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import productos from '../../data/productos.json';
import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/css';

export default function Comprar() {
  const navigate = useNavigate();
  const isLoggedIn = Boolean(localStorage.getItem('token'));

  const handleCompra = (id) => {
    if (!isLoggedIn) {
      alert('Debes iniciar sesiÃ³n o registrarte para comprar productos.');
      navigate('/login');
    } else {
      navigate(`/comprar/${id}`);
    }
  };

  return (
    <Box sx={{ pb: 10, fontFamily: 'Poppins, sans-serif' }}>
      {/* Encabezado */}
      <Box
        sx={{
          position: 'fixed',
          top: 0,
          width: '100%',
          zIndex: 10,
          backgroundColor: '#fff',
          boxShadow: 1,
          px: 3,
          py: 2,
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center'
        }}
      >
        <Typography
          variant="h6"
          component="a"
          href="/"
          sx={{
            textDecoration: 'none',
            color: '#2e7d32',
            fontWeight: 'bold',
            fontSize: '1.3rem'
          }}
        >
          Agripac
        </Typography>

        <Box sx={{ display: 'flex', gap: 2, alignItems: 'center' }}>
          <TextField
            placeholder="Buscar productos..."
            size="small"
            sx={{
              bgcolor: '#f1f8e9',
              borderRadius: 20,
              width: { xs: '140px', md: '200px' }
            }}
            InputProps={{
              startAdornment: (
                <InputAdornment position="start">
                  <SearchIcon sx={{ color: 'gray' }} />
                </InputAdornment>
              )
            }}
          />
          <Button
            variant="outlined"
            href="/login"
            sx={{
              color: '#2e7d32',
              borderColor: '#2e7d32',
              fontWeight: 'bold',
              textTransform: 'uppercase',
              fontSize: '0.75rem'
            }}
          >
            INICIAR SESIÃ“N
          </Button>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, cursor: 'pointer' }}>
            <Typography sx={{ fontSize: '1.2rem' }}>ðŸ›’</Typography>
            <Typography sx={{ fontWeight: 'bold', fontSize: '0.9rem' }}>$0.00</Typography>
          </Box>
        </Box>
      </Box>

      {/* Banner institucional */}
      <Box
        sx={{
          width: '100%',
          height: { xs: 220, md: 320 },
          backgroundImage: 'url("/imagenes/banner-pago.webp")',
          backgroundSize: 'cover',
          backgroundPosition: 'center',
          position: 'relative',
          mt: 10
        }}
      >
        <Box
          sx={{
            position: 'absolute',
            bottom: 20,
            left: 24,
            backgroundColor: 'rgba(0,0,0,0.5)',
            color: '#fff',
            px: 3,
            py: 1,
            borderRadius: 2
          }}
        >
          <Typography sx={{ fontWeight: 'bold', fontSize: '1.1rem' }}>
            Â¿Transferencia o tarjeta? Â¡TÃº eliges!
          </Typography>
        </Box>
      </Box>

      {/* CategorÃ­as estilo Agripac */}
      <Box sx={{ textAlign: 'center', py: 4 }}>
        <Grid container spacing={3} justifyContent="center">
          {[
            { nombre: 'Perro', imagen: '/imagenes/categorias/perro.webp' },
            { nombre: 'Gato', imagen: '/imagenes/categorias/gato.webp' },
            { nombre: 'Limpieza y Aseo', imagen: '/imagenes/categorias/limpieza-y-aseo.webp' },
            { nombre: 'JardinerÃ­a', imagen: '/imagenes/categorias/jardineria.webp' }
          ].map((cat, idx) => (
            <Grid item key={idx}>
              <Box sx={{ textAlign: 'center' }}>
                <Avatar
                  alt={cat.nombre}
                  src={cat.imagen}
                  sx={{
                    width: 100,
                    height: 100,
                    mx: 'auto',
                    border: '2px solid #c8e6c9',
                    bgcolor: '#f1f8e9'
                  }}
                />
                <Typography sx={{ mt: 1, fontWeight: 'bold', color: '#444' }}>
                  {cat.nombre}
                </Typography>
              </Box>
            </Grid>
          ))}
        </Grid>
      </Box>

      {/* Productos destacados */}
      <Box sx={{ px: { xs: 2, md: 4 }, pb: 5 }}>
        <Typography variant="h5" sx={{ fontWeight: 'bold', mb: 3 }}>
          PRODUCTOS <Box component="span" sx={{ color: '#2e7d32' }}>DESTACADOS</Box>
        </Typography>
        <Swiper
          spaceBetween={20}
          slidesPerView={1}
          breakpoints={{
            600: { slidesPerView: 2 },
            960: { slidesPerView: 3 }
          }}
        >
          {productos.map((prod) => (
            <SwiperSlide key={prod.id}>
              <Paper elevation={3} sx={{ p: 2, borderRadius: 3, position: 'relative' }}>
                <img
                  src={prod.imagen}
                  alt={prod.nombre}
                  style={{ width: '100%', borderRadius: 8, objectFit: 'cover' }}
                />
                <Typography variant="h6" sx={{ mt: 2, fontWeight: 'bold' }}>
                  {prod.nombre}
                </Typography>
                <Typography variant="body2" sx={{ color: 'text.secondary', mb: 1 }}>
                  Precio: {prod.precio} USD
                </Typography>
                {prod.descuento && (
                  <Chip
                    label={`-${prod.descuento}%`}
                    color="error"
                    size="small"
                    sx={{ position: 'absolute', top: 10, right: 10 }}
                  />
                )}
                <Button
                  variant="contained"
                  color="success"
                  fullWidth
                  onClick={() => handleCompra(prod.id)}
                  sx={{
                    borderRadius: 30,
                    py: { xs: 1, md: 1.5 },
                    fontWeight: 'bold',
                    fontSize: { xs: '0.9rem', md: '1rem' },
                    mt: 2
                  }}
                >
                  Comprar
                </Button>
              </Paper>
            </SwiperSlide>
          ))}
        </Swiper>
      </Box>
    </Box>
  );
}
